import React from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import { Link } from 'react-router-dom';

const AlertaSesion = (props) => {
    return (
        <Modal
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
         
            centered
        >
            <Modal.Header closeButton className='bg-light'>
                <Modal.Title id="contained-modal-title-vcenter">
                   {props.title}
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <Link                 className="text-decoration-none text-center h1 text-primary"
 to="/registro">Crearme una cuenta</Link>
<br />
<h4>o</h4>
               
               <Link className="text-decoration-none text-center h3 text-secondary" to="/login">Iniciar sesi√≥n</Link>
            </Modal.Body>
            <Modal.Footer>
                <Button onClick={props.onHide} className='btn-danger'>Close</Button>
            </Modal.Footer>
        </Modal>
    );
}

export default AlertaSesion;
